import React from "react";
import style from './food.module.css';


const Recipe = ({ title, image, calory, ingredients, url, label, Diet, healthLabels, ...rest }) => {

  if(healthLabels) {
    healthLabels = healthLabels.map((label, i) => {
      return (<span key = {i} className = "health-label">{label}</span>);
    });
  }

  Recipe.defaultProps = {
    healthLabels: null,
    Diet: "All"
  };

  return (

    <div className={style.food}>
      <img className={style.image} src={image} alt={label}></img>
     <div class="card-body">
      <h1>{title}</h1>
      <p>Calories : {Math.round(calory)}</p>
      <p>Diet: {Diet}</p>
      <p> {healthLabels}</p>

      <ul>
        {ingredients.map((ingredient, index) => (
          <li key={index}>{ingredient.text}</li>
        ))}
      </ul>

    </div>
      <a href={url} target="_blank" class="btn btn-danger" role="button">View Recipe</a>
      </div>
  );

}
export default Recipe;
